    [],nt"revision_timestamp": "2016-07-27T22:21:21.171224",nt"name": "summary-of-1989-san-luis-nwr-and-merced-nwr-grazing-program",nt"isopen":
    false,nt"url": null,nt"notes": "The 1988 grazing programs at San Luis and
    Merced NWR's were quite effective in improving upland habitat for wintering geese,
    sandhill cranes, and other wildlife. The resulting wildlife use provided important
    insight into ways in which the program should be modified to improve its potential
    as a grassland management tool. While documenting wildlife response to the grazing
    program during the 1988/89 winter season, birds seemed to prefer those areas that
    were: 1) relatively free of disturbance; 2) in close proximity to a water source;
    3) adjacent to open, shallow ponds with gently sloping banks to ease bird movement
    between grazing areas and loafing water; and, 4) heavily grazed by sheep (short
    grass or bare ground) for several possible reasons (i.e., increased production of
    and easier access to grass shoots, reduced potential for predator concealment, and
    for cranes, an increase in invertebrates attracted to sheep pellets). This information
    was incorporated into the 1989 program.",nt"license_title": "License Not Specified",nt"extras":
